		public void Test_01_KeyGen(string ModelName, string d, string z, string ρ, string σ,
			string A, string s, string e, string ŝ, string ê, string t, string EncryptionKey,
			string DecryptionKey, bool ConcatenateModelParameter, bool TransposeA)
		{
			byte[] dBin = Hashes.StringToBinary(d);
			byte[] zBin = Hashes.StringToBinary(z);
			Console.Out.WriteLine("d: " + Hashes.BinaryToString(dBin));
			Console.Out.WriteLine("z: " + Hashes.BinaryToString(zBin));

			ML_KEM Model = ML_KEM.GetModel(ModelName);
			ML_KEM_Keys Keys = Model.KeyGen_Internal(dBin, zBin, ConcatenateModelParameter, TransposeA, true);

			Console.Out.WriteLine("ρ: " + Hashes.BinaryToString(Keys.ρ));
			Console.Out.WriteLine("σ: " + Hashes.BinaryToString(Keys.σ));
			Console.Out.WriteLine("Â: " + Expression.ToString(Keys.Â));
			Console.Out.WriteLine("s: " + Expression.ToString(Keys.s));
			Console.Out.WriteLine("e: " + Expression.ToString(Keys.e));
			Console.Out.WriteLine("ŝ: " + Expression.ToString(Keys.ŝ));
			Console.Out.WriteLine("ê: " + Expression.ToString(Keys.ê));
			Console.Out.WriteLine("t: " + Expression.ToString(Keys.t));
			Console.Out.WriteLine("EncryptionKey: " + Hashes.BinaryToString(Keys.EncryptionKey));
			Console.Out.WriteLine("DecryptionKey: " + Hashes.BinaryToString(Keys.DecryptionKey));

			Assert.AreEqual(ρ, Hashes.BinaryToString(Keys.ρ).ToUpper(), "ρ mismatch");
			Assert.AreEqual(σ, Hashes.BinaryToString(Keys.σ).ToUpper(), "σ mismatch");
			Assert.AreEqual(A, Expression.ToString(Keys.Â), "Â mismatch");
			Assert.AreEqual(s, Expression.ToString(Keys.s), "s mismatch");
			Assert.AreEqual(e, Expression.ToString(Keys.e), "e mismatch");
			Assert.AreEqual(ŝ, Expression.ToString(Keys.ŝ), "ŝ mismatch");
			Assert.AreEqual(ê, Expression.ToString(Keys.ê), "ê mismatch");
			Assert.AreEqual(t, Expression.ToString(Keys.t), "t mismatch");
			Assert.AreEqual(EncryptionKey, Hashes.BinaryToString(Keys.EncryptionKey).ToUpper(), "EncryptionKey mismatch");
			Assert.AreEqual(DecryptionKey, Hashes.BinaryToString(Keys.DecryptionKey).ToUpper(), "DecryptionKey mismatch");
		}

		[DataTestMethod]
		[DataRow(
			"CD119AFDC8559442424A87C13EA101E29FCA11881869077E4092E751BEDCA8BC", // d
			"Hello World"
			)]
		public void Test_02_Encrypt(string d, string Message)
		{
			byte[] dBin = Hashes.StringToBinary(d);
			Console.Out.WriteLine("d: " + Hashes.BinaryToString(dBin));

			K_PKE_Keys Keys = ML_KEM.ML_KEM_512.K_PKE_KeyGen(dBin);

			byte[] PlainText = Encoding.UTF8.GetBytes(Message);
			Array.Resize(ref PlainText, 32); // Pad to 32 bytes

			byte[] CipherText = ML_KEM.ML_KEM_512.K_PKE_Encrypt(Keys.EncryptionKey,PlainText);
			
			Console.Out.WriteLine("CipherText: " + Hashes.BinaryToString(CipherText));
		}

		[DataTestMethod]
		[DataRow(
			"CD119AFDC8559442424A87C13EA101E29FCA11881869077E4092E751BEDCA8BC", // d
			"Hello World"
			)]
		public void Test_03_Decrypt(string d, string Message)
		{
			byte[] dBin = Hashes.StringToBinary(d);
			Console.Out.WriteLine("d: " + Hashes.BinaryToString(dBin));

			K_PKE_Keys Keys = ML_KEM.ML_KEM_512.K_PKE_KeyGen(dBin);

			byte[] PlainText = Encoding.UTF8.GetBytes(Message);
			Array.Resize(ref PlainText, 32); // Pad to 32 bytes

			Console.Out.WriteLine("Plain Text (before encryption): " + Hashes.BinaryToString(PlainText));
			Console.Out.WriteLine("A: " + Expression.ToString(Keys.Â));

			byte[] CipherText = ML_KEM.ML_KEM_512.K_PKE_Encrypt(Keys.EncryptionKey, PlainText);

			Console.Out.WriteLine("CipherText: " + Hashes.BinaryToString(CipherText));

			byte[] PlainText2 = ML_KEM.ML_KEM_512.K_PKE_Decrypt(Keys.DecryptionKey, CipherText);

			Console.Out.WriteLine("Plain Text (after decryption): " + Hashes.BinaryToString(PlainText2));

			Assert.AreEqual(PlainText, PlainText2);
		}
	}
